			<p style="font-family: cursive;">Alger est la capitale de l'Alg&eacuterie. Elle se trouve sur la cote m&eacutediterran&eacuteenne du pays. Elle est connue pour les batiments blanchis à la chaux de la Casbah, une m&eacutedina dot&eacutee de rues escarp&eacutees et sinueuses, de palais ottomans et d'une citadelle en ruines. La mosqu&eacutee Ketchaoua, datant du XVIIe siecle, est flanqu&eacutee de 2 immenses minarets. La Grande Mosqu&eacutee possède des colonnes et des arches en marbre. La basilique catholique Notre-Dame d'Afrique, qui se dresse sur une colline, arbore un grand dome argent&eacute et des mosaiques. </p>
